    def generateMatrix(self, n):
        """
        :type n: int
        :rtype: List[List[int]]
        """
        resRow = [0] * n
        res = [resRow] * n

        ind = 1
        roll = 1
        flagn = n % 2
        while roll <= n / 2:
            res[roll - 1] = res[roll - 1][:roll - 1] + list(range(ind, ind + n-2*roll+2)) + res[roll - 1][n - roll+1:]
            ind = ind + n-2*roll+2
            for x in range(1, n - 2 * roll + 1):
                res[roll+x-1] = res[roll+x-1][:n - roll]+[int(ind + x - 1)]+res[roll+x-1][n - roll+1:]
            ind = ind + n - 2 * roll
            tpL = list(range(ind, ind + n-2*roll+2))
            tpL.reverse()
            res[n - roll] = res[n - roll][:roll - 1] + tpL + res[n - roll][n - roll+1:]
            ind = ind + n-2*roll+2
            for x in range(1, n - 2 * roll + 1):
                res[n-x-roll] = res[n-x-roll][:roll-1] + [int(ind + x - 1)]+res[n-x-roll][roll:]
            ind = ind + n - 2 * roll
            roll = roll + 1

        if flagn == 1:
            res[int(n / 2)][int(n / 2)] = n * n
        return res

    def solveNQueens(self, n):
        listRow = [0] * n
        listCol = [0] * n
        listRoL = [0] * (2 * n - 1)
        listRoR = [0] * (2 * n - 1)
        res = []
        self.findSol(listRow, listCol, listRoL, listRoR, [], n, res)
        return res

    def findSol(self, listRow, listCol, listRoL, listRoR, num, n, res):
        if len(num) == n:  # 排除行
            res.append(self.putSol(num))
        else:
            for x in list(set(range(0, n)) - set(num)):  # 排除列
                if listRoL[x + len(num)] == 0 and listRoR[n - len(num) + x - 1] == 0:
                    listRow[len(num)] = 1
                    listCol[x] = 1
                    listRoL[x + len(num)] = 1
                    listRoR[n - len(num) + x - 1] = 1
                    self.findSol(listRow, listCol, listRoL, listRoR, num + [x], n, res)
                    listRow[len(num)] = 0
                    listCol[x] = 0
                    listRoL[x + len(num)] = 0
                    listRoR[n - len(num) + x - 1] = 0

    def putSol(self, num):

        restp = []
        for c in num:
            restp.append('.' * c + 'Q' + '.' * int(len(num) - c - 1))

        return restp

    def canJump(self, nums):
        ind = 0
        indtpo = nums[ind]
        indtp = self.getMax(nums, ind, nums[ind])
        while ind < len(nums)-1:
            if ind+ indtp > len(nums)-2:
                return True
            if indtpo<indtp:
                tp = indtp
                indtp = self.getMax(nums, indtpo, indtp)
                indtpo = tp
            elif indtpo==indtp:
                return False

        return True

    def getMax(self, nums, i, j):
        resTmp = []
        for inde, c in enumerate(nums[i:j+1]):
            resTmp.append(i+inde + c)
        return max(set(resTmp))

    def uniquePaths(self, m: int, n: int) -> int:

        return self.combine(n - 1, n + m - 2, m - 1)

    def combine(self, n, m, k):
        res = 1
        if n < k:
            tp = n
            n = k
            k = tp
        while n < m:
            n = n + 1
            res = res * n

        while k > 1:
            res = res / k
            k = k - 1

        return int(res)

    def uniquePathsWithObstacles(self, obstacleGrid):

        x = len(obstacleGrid)
        y = len(obstacleGrid[0])
        po = [[0 for y in range(y)] for x in range(x)]
        po[0][0] = 1

        for i in range(0, x ):
            po[i][0] = 1
            for j in range(1, y ):
                if obstacleGrid[i][j] == 1:
                    po[i][j] = 0
                elif i == 0:
                    po[i][j] = po[i][j - 1]
                else:
                    po[i][j] = po[i][j - 1] + po[i - 1][j]

        return po[x - 1][y - 1]


    def rotateRight(self, head: ListNode, k: int) -> ListNode:
        tp = head
        resL = []
        tph = ListNode(None)
        if tp == None or tp.next ==None:
            return tp
        while tp.next:
            resL.append(tp.val)
            if k == len(resL) - 1:
                tph = head
            tp = tp.next
            if tph != None:
                tph = tph.next
        resL.append(tp.val)

        if tph != None and tph.next != None:
            tphk = tph.next
            tph.next = None
            tp.next = head

        else:
            k = k % len(resL)
            tphk = ListNode(resL[-k])
            tphkNode = tphk
            if k > 1:
                for c in resL[-k + 1:]:
                    tphkNode.next = ListNode(c)
                    tphkNode = tphkNode.next
            for c in resL[:-k+len(resL)]:
                tphkNode.next = ListNode(c)
                tphkNode = tphkNode.next

        return tphk

