        if nums == []:
            return []
        for c in range(1, len(nums)):
            res[c] = res[c - 1] * nums[c-1]
            rev = 1
        for x in range(len(nums) - 2, -1, -1):
            rev = rev * nums[x + 1]
            res[x] = res[x] * rev

        return res

