    def buildTree(self, preorder, inorder):

        if len(preorder) == 0:
            return []
        ind = inorder.index(preorder[0])
        getleftIn = inorder[:ind]
        if ind<=0:
            getleftPre = []
            getrightIn = inorder[ind + 1:]
            getrightPre = preorder[1:]
        else:
            pre = ind+1
            getleftPre = preorder[1:pre]
            getrightIn = inorder[ind + 1:]
            getrightPre = preorder[pre:]

        root = TreeNode(preorder[0])
        if len(getleftIn) != 0:
            root.left = self.buildTree(getleftPre, getleftIn)
        if len(getrightIn) != 0:
            root.right = self.buildTree(getrightPre, getrightIn)

        return root
